import React from 'react';
import { Container, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import Header from './Header';
import HeroSection from './HeroSection';
import ServicesSection from './ServicesSection';
import Footer from './Footer';

const services = [
  { icon: '/public/dercarga.png', title: 'Ayuda Diagnóstica' },
  { icon: '/public/dercarga.jpg', title: 'Hospitalización' },
  { icon: '/public/vacuna.jpg', title: 'Urgencias 24 Horas' },
  // Agrega más servicios según sea necesario
];

const HomePage = () => {
  return (
    <>
      <Header />
      <HeroSection />
      <Container className="text-center my-5">
        <h1>Bienvenido a la Veterinaria</h1>
        <Link to="/citas">
          <Button variant="primary" className="m-2">Gestionar Citas</Button>
        </Link>
        <Link to="/historias-clinicas">
          <Button variant="secondary" className="m-2">Gestionar Historias Clínicas</Button>
        </Link>
        <Link to="/propietarios">
          <Button variant="success" className="m-2">Gestionar Propietarios</Button>
        </Link>
        <Link to="/mascotas">
          <Button variant="info" className="m-2">Gestionar Mascotas</Button>
        </Link>
        <Link to="/servicios">
          <Button variant="warning" className="m-2">Gestionar Servicios</Button>
        </Link>
      </Container>
      <ServicesSection />
      <Footer />
    </>
  );
};

export default HomePage;
